import React, {Component} from 'react';
import {} from '../components/ImageSiderBar.js';
import Arrowxemthem from '../icons/Arrowxemthem.svg';


export default class Partner extends Component {
    render(){
        return(
            <div style={{background: '#F4F7F9', paddingBottom: 60, display: 'flex', justifyContent: 'center', paddingTop: 50}}>
                <div style={{ width: '88%' }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                        <span style={{fontFamily: 'Roboto', fontSize: 14, color: '#2C2C2C'}}>Đối tác tin cậy</span>
                        <span>
                            <a href="#" style={{ fontFamily: 'Roboto', textDecoration: 'none', fontSize: 13, color: '#C81211', lineHeight: 5 }} ><b>XEM TẤT CẢ</b>
                            <img src={Arrowxemthem} alt="arrowxemthem" style={{ width: 5.6, height: 9, paddingLeft: 5 }} />
                            </a>
                        </span>
                    </div>
                </div>
            </div>
        );
    }
}
